import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home/Home";
import Services from "./pages/Services/Services";
import AboutUs from "./pages/AboutUs/AboutUs";
import ContactUs from "./pages/ContactUs/ContactUs";
import OurWehicle from "./pages/OurWehicle/OurWehicle";
import WehicleDetails from "./pages/OurWehicle/WehicleDetails/WehicleDetails";
import ServicesDetails from "./pages/Services/ServicesDetails/ServicesDetails";
function App() {
  return <div>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/hizmetlerimiz" element={<Services />} />
      <Route path="/hakkimizda" element={<AboutUs />} />
      <Route path="/bizeulasin" element={<ContactUs />} />
      <Route path="/aracfilomuz" element={<OurWehicle />} />
      //WehicleDetailsPages
      <Route path="/arac1" element={<WehicleDetails />} />
      <Route path="/alısveristurlari" element={<ServicesDetails BannerText="ALIŞVERİ TURLARI" title="ALIŞVERİŞ TURLARI BİLGİLENDİRME" text="SGS RENT A CAR olarak sizlere sunduğumuz mercedes vito, vip minibüs ve diğer marka seçenekleri ile kiralama işlemlerinizde yanınızdayız. Daima kalite ve uygun fiyatları ile hizmetinizde olan firmamız için en önemli ilke memnuniyetinizi sağlamak, hem doğru hem güvenilir kiralama hizmeti almanızdır.

Firmamız her zaman ihityacınıza göre sizi yönlendirmeyi ve istediğiniz araçtan tam verim almanızı hedefler. Firmamızda her bütçeye uygun özel dizayna sahip kiralık mercedes vito, kiralık mercedes minibüs ve bir çok vip dizayna sahip araçlarımızla 7/24 sizlerin tüm ihtiyaçlarını karşılayacak profesyonel ekibimizle araç kiralama konusunda hizmetinizdeyiz.

Kiralık mercedes vito fiyatları, diğer araç fiyatlarımız yada ayrıntılı bilgi için bize 0555 865 66 19 numaralı telefondan ulaşabilirsiniz."/>}/>
    </Routes>
  </div>;
}

export default App;
